import './App.css';
import Header from './components/header/Header';
import HeaderBanner from './components/header/HeaderBaner/HeaderBanner';
import Bascet from './components/main/bascet/bascet';
import Catalog from './components/main/catalog';
import Login from './components/main/LoginForm/forms/login';
import HomePage from './components/HomePage';

import { BrowserRouter, Route, Switch } from "react-router-dom";


function App() {

  return (


    <>
      <Header />
      <Switch>
      <Route path="/" component={Bascet} /> 
        <Route path="/jjjk" component={HomePage} /> 



      </Switch>
    </>





  );
}

export default App;
